class Solution {
  int minOperations(List<int> nums1, List<int> nums2) {
    int operations = 0;
    int n = nums1.length;

    // Find max values of both arrays
    int maxNums1 = nums1.reduce((curr, next) => curr > next ? curr : next);
    int maxNums2 = nums2.reduce((curr, next) => curr > next ? curr : next);

    // Check if swapping is needed for the last elements to meet the conditions
    if (nums1[n - 1] != maxNums1 || nums2[n - 1] != maxNums2) {
      for (int i = 0; i < n; i++) {
        // Identify if swapping the current elements will help in meeting the conditions
        if ((nums1[i] == maxNums2 && nums2[i] < maxNums2) || (nums2[i] == maxNums1 && nums1[i] < maxNums1)) {
          // Swap the elements
          int temp = nums1[i];
          nums1[i] = nums2[i];
          nums2[i] = temp;
          operations++;

          // After swapping, check if the conditions are met
          if (nums1[n - 1] == nums1.reduce((curr, next) => curr > next ? curr : next) &&
              nums2[n - 1] == nums2.reduce((curr, next) => curr > next ? curr : next)) {
            return operations;
          }
        }
      }

      // If conditions are not met after possible swaps, return -1
      return -1;
    }

    // If initial arrays already meet the conditions
    return operations;
  }
}
